import React from 'react';

import {NavLink} from 'react-router-dom'

function Header() {
    return (
        <div>
            <h1>Header</h1>

            <NavLink to={'/login'}>Login</NavLink>
            <NavLink to={'/signup'}>signup</NavLink>

        </div>
    )
}

export default Header
